                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
            </NavDropdown> */}
            </Nav>
        </Navbar.Collapse>


                {/* <Button className="ProfileButton" 
                onClick={this.handleButtonClick}
                >
                    <Link to="/SignIn" >
                    <i class="fas fa-user-circle fa-3x profile-color"></i>     
                    </Link>
                </Button> */}




        </nav>


</nav>



        </>
        )
    }
}

export default Navbarr
